import React from 'react'
import { useState } from 'react';
const SignIn = (props) => {
    const [title,setTitle] = useState('');
    const [ description,setDescription] = useState('');
    const submit =(e)=>{
      e.preventDefault();
      if(!title || !description ){
          alert(' not added')
      }

    }
  return (
    <div className="container">
        <h3>Sing In to Start Work</h3>
      <form onSubmit={submit}>
  <div className="mb-3">
    <label for="exampleInputEmail1" className="form-label">Username</label>
    <input type="email" className="form-control" value={title} onChange={(e)=>{setTitle(e.target.value)}} id="exampleInputEmail1" aria-describedby="emailHelp"/>
  </div>
  <div className="mb-3">
    <label for="exampleInputPassword1" className="form-label">Password</label>
    <input type="password" className="form-control" value ={description} onChange={(e)=>{setTitle(e.target.value)}} id="exampleInputPassword1"/>
  </div>
  
  <button type="submit" className="btn btn-sm btn-primary">Submit</button>
</form>
    </div>
  )
}

export default SignIn
